import React from 'react';
import { BrowserRouter as Router} from "react-router-dom";
import Typography from "@material-ui/core/Typography";

const storage = window.localStorage;
storage.token = "eyJhbGciOiJIUzI1NiIsInR5cCI6IkpXVCJ9.eyJ1c2VyX2lkIjoxLCJlbWFpbCI6InN0ZXZ6aGFuZzAxQGdtYWlsLmNvbSIsIm1vYmlsZSI6IjEzOTE5MTU0OTI1Iiwibmlja19uYW1lIjoiU3RldkUuWiIsImltYWdlX3VybCI6IiIsImV4cCI6MTU1NzU2MTMyNSwiaWF0IjoxNTU3NTYwMTI1fQ.Jitn_r_3wSKoZKZZk5jKTOKzV0-dajyQhzJV6EVjMUg";
class User extends React.Component{
    constructor(props) {
        super(props);
        this.state = {
            email: ""
        };
    }
    componentDidMount() {
        fetch('http://localhost:8080/user/profile/', {
            method: "GET",
            mode: "cors",
            cache: 'default',
            headers: {
                "x-originals-token": storage.token
            }
        }).then(rst => {
            this.setState({
                email: "abccdc"
            })
        }).then(data => {
            console.log(data)
            this.setState({
                email: data.result.email
            })
        }).catch(err => {
            console.log(err)
        })
    }

    render() {
        return (
            <Router>
                <div>
                    <Typography component="h1" variant="h5">
                        {this.state.email}
                    </Typography>
                </div>
            </Router>
        );
    }
}

export default User;
